select*from Orase;
create table Orase (id_oras number (3) PRIMARY KEY, judet varchar (50));
select*from Gradinite ;
create table Gradinite (id_gradi number (3) PRIMARY KEY,
id_oras number (3) ,
cod_postal char(10),
id_ang_manager char (3),telefon char (10)
,email varchar (50),
FOREIGN KEY(id_oras)references Orase (id_oras));
select*from Educatori;     
create table Educatori (id_edu number (3)PRIMARY KEY,nume varchar(50),prenume varchar(50),cnp char (20),Id_grad number (3),data_angajare  DATE, adresa varchar(50),telefon char (15),email varchar (50),scoala_absolvita varchar (50));


select*from Grupe;
create table Grupe ( id_grupa number (3)PRIMARY KEY, denumire varchar (20),varsta_copii char(2));
select*from Clase;
CREATE TABLE Clase (
    id_clase NUMBER(3) PRIMARY KEY,
    denumire VARCHAR(20),
    id_gradi NUMBER(3),
    id_grupa NUMBER(3),
    sala VARCHAR(20),
    an_scolar CHAR(15),
    FOREIGN KEY(id_gradi) REFERENCES Gradinite(id_gradi),
    FOREIGN KEY(id_grupa) REFERENCES Grupe(id_grupa)
);

