select*from angajati;
CREATE TABLE angajati (
    id_ang NUMBER(5) PRIMARY KEY,
    nume VARCHAR(50),
    prenume VARCHAR(50),
    data_angaj DATE,
    adresa VARCHAR(50),
    telefon CHAR(15),
    email VARCHAR(50),
    functie VARCHAR(50),
    id_gradi NUMBER(5),
