select*from aptitudini;
CREATE TABLE aptitudini (
    id_aptit NUMBER(5) PRIMARY KEY,
    denumire VARCHAR(100),
    domeniu VARCHAR(100),
    descriere VARCHAR(300)
);

select*from Copii_aptitudini;
CREATE TABLE copii_aptitudini (
    id_coap NUMBER(5) PRIMARY KEY,
    id_copil NUMBER(5),
    id_aptit NUMBER(5),
    gradul VARCHAR(50),
    FOREIGN KEY (id_copil) REFERENCES copii(id_copil),
    FOREIGN KEY (id_aptit) REFERENCES aptitudini(id_aptit)
    
);










select*from Activitati;
create table Activitati (id_activ number (5) PRIMARY KEY,denumire varchar (100),descriere varchar(250));
drop table Activitati;
select*from Evidenta_Activitati;
CREATE TABLE Evidenta_Activitati (
    id_evac NUMBER(5) PRIMARY KEY,
    id_clase NUMBER(5),
    id_activ NUMBER(5),
    locatia VARCHAR(50),
    durata VARCHAR(50),
    FOREIGN KEY (id_clase) REFERENCES Clase(id_clase),
    FOREIGN KEY (id_activ) REFERENCES Activitati(id_activ)
);
drop table Evidenta_Activitati;


select*from Evidenta_absente;
CREATE TABLE Evidenta_absente (
    id_eva NUMBER(5) PRIMARY KEY,
    id_copil NUMBER(5),
    data_absen DATE,
    data_revenirii DATE,
    motiv VARCHAR(500),
    FOREIGN KEY (id_copil) REFERENCES Copii(id_copil)
);

select*from Evenimente;
CREATE TABLE Evenimente (
    id_ev NUMBER(5) PRIMARY KEY,
    denumire VARCHAR(100),
    tip_eveniment VARCHAR(100),
    id_gradi NUMBER(5),
    data_ev DATE,
    locatia VARCHAR(200),
    interval_orar VARCHAR(100),
    descriere VARCHAR(500),
    FOREIGN KEY (id_gradi) REFERENCES Gradinite(id_gradi)
);

























































